import React from 'react'
import { Card } from '../Components/Card'

export const MoviePage = (props) => {
  return (

    <>

        {props.movies.map((movie)=>{
                return (
                  <Card movie={movie} key={movie.sno} />
                )
        })}
        <Card/>
    </>
  )
}
